CREATE TABLE `article` (
    `id` INT AUTO_INCREMENT PRIMARY KEY,
    `name` VARCHAR(255) DEFAULT NULL,
    `description` TEXT,
    `price` FLOAT DEFAULT NULL,
    `reduction` INT DEFAULT NULL,
    `date_ajout` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
    `category` VARCHAR(255) DEFAULT NULL,
    `age` VARCHAR(255) DEFAULT NULL,
    `stock` INT DEFAULT NULL,
    `image` LONGBLOB
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(1, 'chemise', 'Adoptez le style à rayures tendance avec notre charmante chemise courte pour fille. Pensée pour allier confort et élégance, cette pièce apporte une touche moderne à la garde-robe de votre petite fashionista. Le col à revers confère à la chemise une allure décontractée et stylée, tandis que les manches longues ajoutent une note de sophistication. ', 90, NULL, '2024-04-11 20:29:07', 'pull', 'enfant', 150, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(2, 'Veste Denim', 'Optez pour un look décontracté et tendance avec notre veste en Denim pour Fille, une pièce qui marie style et confort. Doté d\'un col à revers, de manches longues, d\'emmanchures carrées avec bouton, et d\'une patte de boutonnage au devant, cette veste en denim offre une esthétique moderne et décontractée. Les deux poches plaquées au devant ajoutent une touche pratique, tandis que les strass scintillants sur l\'une des poches apportent une note ludique et glamour. ', 79, 15, '2024-04-11 20:29:07', 'pull', 'enfant', 100, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(3, 'Basket en blanc', 'Offrez à votre petite nos baskets en similicuir spécialement conçues pour les fillettes. Dotées d\'une fermeture à scratch pratique, elles allient facilité d\'utilisation et sécurité pour les petits pieds en pleine croissance. La doublure intérieure en scratch assure un ajustement personnalisé et sécurisé, permettant à votre fillette de se sentir à l\'aise tout au long de la journée. La semelle extérieure haute, fabriquée en élastomère antidérapant, offre une adhérence maximale, assurant une stabilité optimale lors des activités quotidiennes. Conçues pour être résistantes et souples, ces baskets en similicuir sont idéales pour accompagner votre enfant dans ses aventures quotidiennes tout en ajoutant une touche de style à ses tenues.', 120, NULL, '2024-04-11 20:31:43', 'chaussures', 'enfant', 400, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(4, 'SAC A BANDOULIÈRE', 'Explorez le monde enchanté de la mode enfantine avec notre Sac à Bandoulière en Forme de Papillon, une pièce unique qui émerveillera les jeunes fashionistas. Ce sac se démarque par son papillon scintillant à paillettes sur le devant, créant un effet 3D qui ajoute une touche de magie à chaque tenue.', 49, 10, '2024-04-11 20:31:43', 'accessoire', 'enfant', 500, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(5, 'JEAN MÉTALLISÉ', 'Mettez en valeur votre style avec notre pontalon Jean pour Femme à l\'effet métallique éblouissant. Conçu pour ajouter une touche de glamour à votre garde-robe, ce jean est un choix audacieux pour celles qui veulent se démarquer avec élégance. Doté d\'une braguette zippée montée d\'un bouton et de cinq poches classiques, ce jean offre à la fois fonctionnalité et style. Les passants pour ceinture vous permettent de personnaliser votre tenue en ajoutant une ceinture assortie.', 99, NULL, '2024-04-11 20:34:15', 'pontalon', 'adulte', 800, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(6, 'BASKET EN BLANC', 'Mettez en valeur votre style avec nos Baskets pour Femme, une fusion parfaite de confort et de style. Conçues pour vous offrir un look tendance et un confort optimal, ces baskets sont un choix idéal pour toutes vos aventures quotidiennes. Dotées d\'un empiècement en toile qui apporte une touche de légèreté et de modernité au design, ces baskets offrent également une doublure en tissu pour un confort douillet tout au long de la journée. ', 119, NULL, '2024-04-11 20:34:15', 'chaussure', 'adulte', 450, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(7, 'mocassin', 'Optez pour un look frais et élégant avec notre mocassin femme à plateforme crantée noire contrastante. Cette chaussure polyvalente et tendance est parfaite pour celles qui recherchent un style moderne et sophistiqué. Ce mocassin apporte une touche de luminosité et de pureté à votre tenue. Sa simplicité ajoute une touche de sophistication, attirant immédiatement les regards. ', 109, NULL, '2024-04-11 20:37:56', 'chaussure', 'adulte', 800, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(8, 'sac de plage', 'Notre sac de plage pour femme est le compagnon parfait pour vos journées ensoleillées à la plage ou à la piscine. Ce sac spacieux et élégant est conçu pour vous offrir tout ce dont vous avez besoin pour passer une journée parfaite au bord de l\'eau. Le sac est fabriqué à partir de matériaux de haute qualité, ce qui le rend durable et résistant à l\'eau. ', 95, 20, '2024-04-11 20:37:56', 'accessoire', 'adulte', 150, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(9, 'BOUCLES D\'OREILLES TRINITY', 'Boucles d\'oreilles Trinity, or gris 750/1000, or rose 750/1000, or jaune 750/1000. Largeur 3.3mm. Diamètre intérieur 13.2mm.\r\n\r\nVeuillez noter que le poids en carats, le nombre de pierres et les dimensions du produit peuvent varier en fonction de la taille de la création commandée.', 1500, NULL, '2024-04-11 20:41:29', 'acessoire', 'adulte', 700, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(10, 'parfum MIDNIGHT', 'Eternal Glamour - L\'Élégance Éternelle : Plongez dans l\'essence de l\'élégance éternelle avec \"Eternal Glamour\". Les notes riches de patchouli église, la douceur enivrante du jasmin et la fraîcheur lumineuse de l\'orange s\'unissent pour créer une symphonie olfactive qui évoque la quintessence de la féminité éternelle.', 45, 25, '2024-04-11 20:41:29', 'parfum', 'adulte', 500, );
INSERT INTO `article` (`id`, `name`, `description`, `price`, `reduction`, `date_ajout`, `category`, `age`, `stock`, `image`) VALUES
(11, 'parfum Pinky Girl', 'Découvrez \"Pinky Girl\", le parfum qui évoque la délicatesse et la grâce de la féminité. Chaque note, du magnolia enchanteur à la rose romantique, en passant par le musc blanc apaisant, crée une symphonie olfactive qui transporte vers un monde de douceur et d\'élégance.', 39, 25, '2024-04-11 20:43:04', 'parfum', 'enfant', 250, );
